import moment from 'moment';

export function gerarHTML(pdfConfig:{autor: string, fundoTipo: string, fundoNome: string, descricao: string, numeroTitulo: number, tituloPDF: string}): string {

    const agora = moment().locale('pt-br');

    const data = {
        dia: agora.date(),
        mes: agora.format('MMMM'),
        hora: agora.format('HH:mm')
    };

    return `
    <!DOCTYPE html>
    <html lang="pt" class="master">
    
    <head>
        <meta charset="UTF-8">
        <meta name="viewport" content="width=device-width, initial-scale=1.0">
        <title>PDF Template</title>
    
        <style>
    
            h1 {
                font-size: 34px;
                font-family: 'Times New Roman', Times, serif;
            }
    
            p {
                font-size: 28px;
                font-family: 'Times New Roman', Times, serif;
    
            }
    
            table {
                text-align: center;
                margin-left: auto;
                margin-right: auto;
                border-collapse: collapse;
                font-family: 'Times New Roman', Times, serif;
            }
    
            th {
                border: 2px solid black;
                padding: 8px;
                background-color: #e7e4e4;
                font-size: 26px;
            }
    
            td {
                border: 2px solid black;
                padding: 8px;
                background-color: #b0b0b0;
                font-size: 26px;
            }
    
            .master {
                width: 100%;
                height: 100%;
                background-color: rgba(246, 117, 33, 0.8)
            }
    
            .container {
                text-align: center;
                width: 50%;
                display: block;
                margin: 0 auto;
            }
    
            .dados {
                text-align: center;
                width: 100%;
                display: block;
                margin: 0 auto;
            }
        </style>
    
    </head>
    
    <body>
        <div>
            <div class="container">
                <h1><span>SUPORTE FIDC</span></h1>
                <p><span><b>${pdfConfig.autor.toUpperCase()}</b></span></p>
    
                <img src='data:image/png;base64,' alt="Base 64 LOGO">
            </div>
    
            <div class="dados">
                <h1>${pdfConfig.fundoTipo.toUpperCase()} ${pdfConfig.fundoNome.toUpperCase()}</h1>
    
                <table>
                    <thead>
                        <tr>
                            <th>Hora</th>
                            <th>Dia</th>
                            <th>Ms</th>
                            <th>${pdfConfig.tituloPDF.toUpperCase()} ${pdfConfig.numeroTitulo}</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <td>${data.hora}</td>
                            <td>${data.dia}</td>
                            <td>${data.mes.toUpperCase()}</td>
                            <td>${pdfConfig.descricao}</td>
                        </tr>
                    </tbody>
                </table>
            </div>
        </div>
    
    </body>
    </html>
    `;
}

